using P = std::tuple<int,int,int>;
using PS = P[6];
PS cells[3][3][3];

std::string Pstr(P p){
    std::string str;
    str += "(";
    str += "Point3d ";
    str += std::to_string(std::get<0>(p));
    str += " ";
    str += std::to_string(std::get<1>(p));
    str += " ";
    str += std::to_string(std::get<2>(p));
    str += ")";
    return str;
}

std::string tuplestr(const std::array<int,4>& arr){
    std::string str;
    auto N = arr.size();
    str += "(";
    for(auto i=0; i<N; i++){
        str += std::to_string(arr.at(i));
        if(i!= N-1){
            str += ",";
        }
    }
    str += ")";
    return str;
}

std::string PSstr(PS& ps){
    std::string str;
    str += "[";
    for(int i = 0; i<6;i++){
        str += Pstr(ps[i]);
        if(i != 5){
           str += ",";
        }
    }
    str += "]";
    return str;
}

P operator+(P p1,P p2){
    return P{
        std::get<0>(p1)+std::get<0>(p2),
        std::get<1>(p1)+std::get<1>(p2),
        std::get<2>(p1)+std::get<2>(p2)
    };
}

int point2index(int x,int y ,int z){
    auto dx = x == (y==0 ? 0 : 1) ? 0 : 1;
    auto dy = y == 0 ? 0 : 1;
    auto dz = z == 0 ? 0 : 1;
    return dx+2*dy+4*dz+1;
}

